        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "Vietnamin lakien mukaan käyttäjien tiedot, kuten nimet, sähköpostiosoitteet, salasanat ja syntymäaika, voidaan luokitella \"henkilökohtaisiksi tiedoiksi\".\n\n Erityisesti,\n (a) Asetuksen 72/2013 mukaan henkilötiedoilla tarkoitetaan tietoja, jotka liitetään henkilön henkilöllisyyden ja henkilötietojen tunnistamiseen, mukaan lukien nimi, ikä, osoite, henkilöllisyystodistuksen numero, puhelinnumero, sähköpostiosoite ja muut tiedot lain mukaan\n\n (b) Kiertokirjeen 25/2010 mukaan henkilötiedoilla tarkoitetaan tietoja, jotka riittävät yksilöimään tarkasti ja jotka sisältävät vähintään yhden seuraavista tiedoista: koko nimi, syntymäaika, ammatti, virka, yhteyshenkilö, sähköpostiosoite, puhelinnumero, henkilöllisyys kortin numero ja passin numero. Henkilötietoihin kuuluvat terveystiedot, veronmaksutiedot, sosiaalivakuutuskortin numero, luottokortin numero ja muut henkilökohtaiset salaisuudet.\n\n Kiertokirje 25 koskee henkilötietojen keräämistä ja käyttöä Vietnamin viranomaisten ylläpitämillä verkkosivustoilla. Kiertokirje 25 ei koske suoraan muiden kuin julkisyhteisöjen ylläpitämien verkkosivustojen keräämiä ja käyttämiä henkilötietoja. Kiertokirjeen 25 määräyksiä voitaisiin kuitenkin soveltaa vastaavasti. Lisäksi on todennäköistä, että valtiosta riippumattomaan yhteisöön sovelletaan samoja tai tiukempia standardeja kuin julkisyhteisöön."),
